text382717.addInnerText('<div id=\"text382717\" aria-live=\"polite\" ><a id=\"text382717anc\" style=\"display:block;height:0px;width:0px;\"></a>\n<table style=\"border-collapse:collapse;top:0px;position:absolute; border-spacing:0; width:100%; height:100%\">\n<tr>\n<td style=\"position: absolute;top:0px;left:0px;box-sizing:border-box;width:100%;vertical-align:top;height:100%;padding:5px\">\n<div style=\'height:100%;width:100%;overflow-y:hidden;overflow-x:hidden;\'>\n\n<p lang=\"en\"  legLH=\"1.284\" style=\"margin-left:0px;text-indent:0px;line-height:1.041;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text382717Font2\"  >​\n</span ></p >\n<p  legLH=\"1.229\" style=\"margin-left:0px;text-indent:0px;line-height:1.229;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text382717Font4\" style=\"position:relative;top:-1px;\" >Over Classification - Creates two major problems for Defence:&nbsp;\n</span ></p >\n<p  legLH=\"1.229\" style=\"margin-left:0px;text-indent:0px;line-height:1.229;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text382717Font4\" style=\"position:relative;top:-1px;\" >​</span ><span class=\"text382717Font2\" style=\"background-color:transparentposition:relative;top:-1px;\" >\n</span ></p >\n<ul  style=\"list-style-position:outside;text-align:left;\" >\n<li  class=\"text382717Font4\" data-bltIndnt=\"0\" style=\"line-height:1.229;position:relative;margin-left:16px;margin-top:0px;margin-bottom:0px; list-style-image:url(\'images/text382717CircleBulletFont9.png\'); padding-left:7px;\"><!--{ \ndata-bltIndnt:0\n} --><span class=\"text382717Font4\"  >Higher classification documents cost far more to manage. Higher classification documents require more protection, which means higher physical security costs, SAFEHAND delivery costs and encryption costs for all of our systems and locations.&nbsp;\n</span ></li >\n<li  class=\"text382717Font4\" data-bltIndnt=\"0\" style=\"line-height:1.229;position:relative;margin-left:16px;margin-top:0px;margin-bottom:0px; list-style-image:url(\'images/text382717CircleBulletFont9.png\'); padding-left:7px;\"><!--{ \ndata-bltIndnt:0\n} --><span class=\"text382717Font4\"  >They limit access to key information that many staff need to do their job. You know that higher security clearances can take some time to process. But have you considered that if we over-classify something to \'be on the safe side\' we may actually be making Defence less safe? When you classify information correctly, you ensure the information gets where it needs to right now. Delayed access to critical information due to over classification, could mean the difference between life and death.&nbsp; \n</span ></li >\n</ul >\n\n\n</div></td>\n</tr>\n</table>\n</div>\n');
text382717.build()
